import React from 'react';

function StadiumPage({ stadiums }) {
  const itemsPerPage = 7; // 한 페이지에 표시할 체육 시설 수


  return (
    <div>
      <h1>체육 시설 목록</h1>

      {getCurrentPageItems(stadiums, 1).map((stadium, index) => (
        <div key={index}>
          <h3>{stadium.stadium_name}</h3>
          <p>{stadium.stadium_location}</p>
        </div>
      ))}

      {/* 페이지 번호 등 추가 UI 요소 */}
    </div>
  );
}

export default StadiumPage;
